import React from 'react';
import ReactDOM from 'react-dom/client';
import './styles.css'
import { Home } from './pages/Home'
import { App } from './App'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App>
      <Home />
    </App>
  </React.StrictMode>
);
